import { configureStore } from "@reduxjs/toolkit";
import featureReducer from "./featureReducer";
import wktReducer from './wktSlice';


export const store = configureStore({
  reducer: {
    feature: featureReducer,
    wkt: wktReducer,
  },
});

export default store;
